      //the add data button is clicked //This pushes one hour of anomalous data
using System;
using System.IO;
using System.Text;
using System.Linq;
using System.Globalization;
using Skyline.DataMiner.Scripting;
using Skyline.DataMiner.Net.Messages;
using System.Collections.Generic;
using System.Diagnostics;
using System.Threading;
public class QAction
{
    public static void Run(SLProtocol protocol) //This pushes one hour of anomalous data
    {
		protocol.Log("Add data button clicked");

        int numLines = int.Parse(protocol.GetParameter(9).ToString(), CultureInfo.InvariantCulture);
		if (numLines < 2200) //we did not receive not enough data for jump start yet
		{
			return; //still reading in history of values
       	}

		List<Double> sum = new List<Double> {
	739.65, 740.69, 738.6, 739.41, 739.74, 739.42, 738.87, 738.95, 735.22, 737.2, 739.29, 737.57, 738.34, 737.59, 736.56, 739.82, 739.19, 739.99, 738.84, 738.5, 737.25, 740.18, 740.71, 743.15, 739.22
	};

	List<Double> pa1 = new List<Double> {
	276.69, 277.86, 276.26, 277.46, 277.58, 276.76, 276.66, 277.2, 276.11, 275.82, 276.97, 276.01, 277.15, 276.84, 275.93, 276.94, 277.02, 278.56, 276.71, 276.54, 276.47, 278.02, 277.44, 278.62, 277.27
	};

	List<Double> pa2 = new List<Double> {
	279.41, 280.02, 278.6, 280.52, 279.93, 280.23, 280.37, 279.83, 278.13, 279.9, 280.16, 278.66, 279, 279.55, 279.24, 280.96, 278.98, 278.8, 279.35, 280.12, 278.9, 281.07, 281.19, 280.87, 279.55, 279.32
	};

	List<Double> pa3 = new List<Double> {
	281.22, 282.74, 281.85, 279.74, 281.76, 283.02, 280.95, 280.64, 280.02, 280.52, 281.99, 282.25, 281.43, 279.52, 281.56, 282.65, 281.36, 281.94, 281.55, 281.12, 282.18, 280.68, 282.31, 282.14, 281.95
	};

		int pollingTime = 300;
        int nrOfSteps = 12;
        DateTime now = DateTime.Now;
	    var timeOfProcessing = now.AddSeconds(-pollingTime * nrOfSteps);
		var nextLine = 0;
		while (timeOfProcessing <= now.AddSeconds(-pollingTime))
        {
            protocol.SetParameter(1022,sum[nextLine],timeOfProcessing);

			//set PA Measurements
			for (int i = 0; i < 3; i++) {
				object[] row = new object[6];
				string row_key = "PA" + (i+1).ToString();
				row[0] = row_key;				
				if(i==0){
					row[1] = -12.3;	
					row[2] = pa1[nextLine];
					row[3] = 24.4;
					row[4] = 40;
					row[5] = 31;
				}
				else if(i==1){
					row[1] = -12.1;	
					row[2] = pa2[nextLine];
					row[3] = 19.8;
					row[4] = 41;
					row[5] = 33;
				}
				else{
					row[1] = -12.6;	
					row[2] = pa3[nextLine] - (Math.Min(nextLine,10)+3)/2.0;
					row[3] = 23.3;
					row[4] = 42;
					row[5] = 32;
				}
				protocol.SetRow(2240, row_key, row, timeOfProcessing);		
			}


            nextLine++;
        	if(nextLine>=sum.Count){
            	nextLine=0;
	        }
	        timeOfProcessing=timeOfProcessing.AddSeconds(pollingTime);
        }
		protocol.SetParameter(4, timeOfProcessing.ToOADate());        

    }

}


