    {
		protocol.Log("Add data button clicked");

        int numLines = int.Parse(protocol.GetParameter(9).ToString(), CultureInfo.InvariantCulture);
		if (numLines < 2200) //we did not receive enough data for jump start yet
		{
			return; //still reading in history of values
       	}

