	};

		int pollingTime = 300;
        int nrOfSteps = 12;
        DateTime now = DateTime.Now;
	    var timeOfProcessing = now.AddSeconds(-pollingTime * nrOfSteps);
		var nextLine = 0;
		while (timeOfProcessing <= now.AddSeconds(-pollingTime))
        {
            protocol.SetParameter(1022,sum[nextLine],timeOfProcessing);

			//set PA Measurements
			for (int i = 0; i < 3; i++) {
				object[] row = new object[6];
